import React from 'react';
import './Navigation.css'

const Navigation = () => {
	return (
		<div>
			<nav className='mv3 margv'>
				<ul className='fixed flex bb b--white-10'>
					<li className='spcbtwn f3'><a href=''>About</a></li>
					<li className='spcbtwn f3'><a href=''>Projects</a></li>
					<li className='spcbtwn f3'><a href=''>Contact</a></li>
				</ul>
			</nav>
		</div>
	);
}

export default Navigation;
